import React, { useContext } from 'react';
import Container from './components/container';
import AppContext from './contexts/app-context';

function App() {
  const value = useContext(AppContext)
  return (
    <AppContext.Provider value={value}>
        <Container/>
    </AppContext.Provider>
  );
}
export default App;
